import {GoogleLogin} from "react-google-login";

const cliendid = "501816916441-50t2r4ud6jsla2bu3a4ggtdg8vbumocm.apps.googleusercontent.com"

function Login (){
  const onSuccess = (res) => {
    console.log("LOGIN SUCCESS! current user: ", res.profileObj);
  }

  const onFailure = (res) => {
    console.log("LOGIN FAILURE! RES: ", res);
  }

  return(
  <div id="signInButton">
    <GoogleLogin
      clientId={cliendid}
      buttonText="Login"
      onSuccess={onSuccess}
      onFailure={onFailure}
      cookiePolicy={'single_host_origin'}
      isSignedIn={true}
   />
  </div>
  )
}

export default Login;
